var title_f39_50_40738="Angle-closure glaucoma";
var content_f39_50_40738=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F59454&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F59454&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute angle-closure glaucoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 294px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     The pupillary margin blocks the passage of aqueous from the posterior chamber to the anterior chamber (pupillary block), ballooning the iris forward (iris bombe), causing the iris root to occlude the trabecular meshwork and completely obstruct drainage of aqueous fluid from the anterior chamber (angle closure). The resulting rapid elevation of intraocular pressure requires urgent intervention to prevent permanent visual loss.",
"    </p>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Trobe JD. The Physician's Guide to Eye Care. Foundation of the American Academy of Ophthalmology, San Francisco, 2001. p.158. Copyright &copy; American Academy of Ophthalmology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
