"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   <p>",
"    (For additional information",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?15/61/16344?source=see_link\">",
"     see \"Albuterol (salbutamol): Drug information\"",
"    </a>",
"    and",
"    <a class=\"drug drug_pediatric\" href=\"mobipreview.htm?38/54/39782?source=see_link\">",
"     see \"Albuterol (salbutamol): Pediatric drug information\"",
"    </a>",
"    )",
"   </p>",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F130976\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      AccuNeb&reg;;",
"     </li>",
"     <li>",
