var title_f39_50_40747="Predictors of stroke in atrial fibrillation";
var content_f39_50_40747=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F64291&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F64291&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical and echocardiographic predictors of stroke in atrial fibrillation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Clinical factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        History of hypertension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Recent (within 3 months) HF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Previous cerebrovascular event (stroke or TIA)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Echocardiographic factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Global left ventricular dysfunction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Dilated atrium on M-mode (&ge;4.7 cm or 2.4 cm/m2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Stroke risk (per year) based on clinical factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No risk factors",
"       </td>",
"       <td>",
"        2.5 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 risk factor",
"       </td>",
"       <td>",
"        7.2 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 or 2 risk factors",
"       </td>",
"       <td>",
"        17.6 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Stroke risk (per year) based on clinical and echocardiographic factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No risk factors",
"       </td>",
"       <td>",
"        1.0 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 risk factor",
"       </td>",
"       <td>",
"        6.0 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2 or 3 risk factors",
"       </td>",
"       <td>",
"        18.6 percent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Stroke Prevention in Atrial Fibrillation Investigators. Ann Intern Med 1992; 116:1 and 1992; 116:6.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
